window.bookSummaryJSON = "<p><b>Winner, 2017 APA Audie Awards - Science Fiction </b></p> <p>A <i>New York Times</i> best seller: The official novelization of <i>Star Wars: The Force Awakens</i>, the blockbuster film directed by J. J. Abrams. </p> <p>More than 30 years ago, <i>Star Wars</i> burst onto the big screen and became a cultural phenomenon. Now the next adventures in this blockbuster saga are poised to captivate old and new fans alike - beginning with the highly anticipated <i>Star Wars: The Force Awakens</i>. And alongside the cinematic debut comes the thrilling novel adaptation by <i>New York Times</i> best-selling science fiction master Alan Dean Foster. </p> <p>Set years after <i>Return of the Jedi</i>, this stunning new action-packed adventure rockets us back into the world of Princess Leia, Han Solo, Chewbacca, C-3PO, R2-D2, and Luke Skywalker, while introducing a host of exciting new characters. Darth Vader may have been redeemed and the Emperor vanquished, but peace can be fleeting, and evil does not easily relent. Yet the simple belief in good can still empower ordinary individuals to rise and meet the greatest challenges. </p> <p>So return to that galaxy far, far away, and prepare yourself for what happens when the Force awakens. </p>"; 
